import { setInitialConfigs } from 'utils/helpers'
import './styles/App.scss';

interface Props {}

setInitialConfigs()

const App:FC<Props> = (): JSX.Element => (
  <Router>
    <Header />

    <AppRoutes />

  </Router>
);

export default App;
